import './App.css';
import { Button } from 'reactstrap';
import { ToastContainer, toast } from 'react-toastify';

function App() {
  const notify = () => toast("Wow so easy!");
  return (

  <div>
    <h1>This is bootstrap components</h1>
    <button onClick={notify}>Notify!</button>
    <ToastContainer />
  </div>
  );
}

export default App;
